import React from "react";
import { useSelector } from "react-redux";

const MyOrder = () => {
  // Assuming productCartItem contains the purchased items
  const productCartItem = useSelector((state) => state.product.cartItem);

  return (
    <div>
      <h2>My Orders</h2>
      <table>
        <thead>
          <tr>
            <th>Item Name</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Total</th>
            {/* Add more table headers if needed */}
          </tr>
        </thead>
        <tbody>
          {productCartItem.map((item) => (
            <tr key={item._id}>
              <td>{item.name}</td>
              <td>{item.price}</td>
              <td>{item.qty}</td>
              <td>{item.total}</td>
              {/* Add more table cells if needed */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MyOrder;
